import React from 'react'
// import LinkImage from '../images/Link.svg';
import github from '../images/github.svg';
import { Link } from 'react-router-dom'

function ProjectItem({ projectImage, project }) {
    return (
        <div className="project_item">
            <div className="project_item-image"> <img src={projectImage} alt={project.imagePath} /> </div>
            <div className="project_item-comment">
                <h3>{project.title}</h3>
                <span>2021</span>
                <div><Link to={project.projecturlddress} target="_blank"><img src={github} alt="gitHub" /></Link></div>
                <div><Link to={project.projecturlddress} target="_blank"><img src="hfhfhfh" alt="Link" /></Link></div>
            </div>
        </div>
    )
}

export default ProjectItem
